static int alloc_addbyter ( int output , FILE * data ) {
  struct asprintf * infop = ( struct asprintf * ) data ;
  unsigned char outc = ( unsigned char ) output ;
  if ( ! infop -> buffer ) {
  infop -> buffer = malloc ( 32 ) ;
  if ( ! infop -> buffer ) {
  infop -> fail = 1 ;
  return - 1 ;
  }
  infop -> alloc = 32 ;
  infop -> len = 0 ;
  }
  else if ( infop -> len + 1 >= infop -> alloc ) {
  char * newptr ;
  newptr = realloc ( infop -> buffer , infop -> alloc * 2 ) ;
  if ( ! newptr ) {
  infop -> fail = 1 ;
  return - 1 ;
  }
  infop -> buffer = newptr ;
  infop -> alloc *= 2 ;
  }
  infop -> buffer [ infop -> len ] = outc ;
  infop -> len ++ ;
  return outc ;
  }

char * curl_mvaprintf ( const char * format , va_list ap_save ) {
  int retcode ;
  struct asprintf info ;
  info . buffer = NULL ;
  info . len = 0 ;
  info . alloc = 0 ;
  info . fail = 0 ;
  retcode = dprintf_formatf ( & info , alloc_addbyter , format , ap_save ) ;
  if ( ( - 1 == retcode ) || info . fail ) {
  if ( info . alloc ) free ( info . buffer ) ;
  return NULL ;
  }
  if ( info . alloc ) {
  info . buffer [ info . len ] = 0 ;
  return info . buffer ;
  }
  else return strdup ( "" ) ;
  }

static int jbig2_word_stream_buf_get_next_word ( Jbig2WordStream * self , int offset , uint32_t * word ) {
  Jbig2WordStreamBuf * z = ( Jbig2WordStreamBuf * ) self ;
  const byte * data = z -> data ;
  uint32_t result ;
  if ( offset + 4 < z -> size ) result = ( data [ offset ] << 24 ) | ( data [ offset + 1 ] << 16 ) | ( data [ offset + 2 ] << 8 ) | data [ offset + 3 ] ;
  else if ( offset > z -> size ) return - 1 ;
  else {
  int i ;
  result = 0 ;
  for ( i = 0 ;
  i < z -> size - offset ;
  i ++ ) result |= data [ offset + i ] << ( ( 3 - i ) << 3 ) ;
  }
  * word = result ;
  return 0 ;
  }

